      AND LOWER(TRIM(last_name)) = @normalized_customer_last_name



      AND LOWER(TRIM(email)) = @normalized_email



    LIMIT 1;
    IF customerId IS NULL THEN



        INSERT INTO customers (



            first_name,



            last_name,



            phone,



            email,



            street,



            city,



            state,



